namespace StarMap2D.Utilities;

/// <summary>
/// A class for holding data for a city name, latitude and longitude
/// </summary>
public class CityLatLonCoordinate
{
    /// <summary>
    /// Latitude of a city
    /// </summary>
    public double Latitude { get; set; }

    /// <summary>
    /// Longitude of a city
    /// </summary>
    public double Longitude { get; set; }

    /// <summary>
    /// A city name
    /// </summary>
    public string? CityName { get; set; }

    /// <summary>
    /// An ascii-format city name
    /// </summary>
    public string? CityNameAscii { get; set; }

    /// <summary>
    /// Wether the classes ToString() method should return CityName or CityNameAscii.
    /// </summary>
    public bool UseAsciiName { get; set; }

    /// <summary>
    /// An english province name
    /// </summary>
    public string? Province { get; set; }

    /// <summary>
    /// An ISO2 two letter country code
    /// </summary>
    public string? Iso2 { get; set; }

    /// <summary>
    /// An ISO3 three letter country code
    /// </summary>
    public string? Iso3 { get; set; }

    /// <summary>
    /// An english country name
    /// </summary>
    public string? Country { get; set; }

    /// <summary>
    /// Gets either the CityName or CityNameAscii value.
    /// </summary>
    /// <returns>Either the CityName or CityNameAscii value.</returns>
    public override string ToString()
    {
        return (UseAsciiName ? CityNameAscii : CityName) ?? string.Empty;
    }
}

